function Post({onvanPer, onvanEng, writer , age,date,content}){
    return (
        <div>
            <h1>
                {onvanPer}
            </h1>
            <h1>
                {onvanEng}
            </h1>
            <span>age: {age}</span>
            <span>Writer name: {age}</span>

            <time>{date}</time>
            <p dangerouslySetInnerHTML={{__html:content}} />
        </div>
    );
}

export default Post;
